import React, { useState } from "react";

const App=()=>{
const[num,setNum]=useState(0);
const[num2,setNum2]=useState(0);

return(
  <>
    <button onClick={()=>{
      setNum(num+1)
    }} ></button>
    <button onClick={()=>{
      setNum2(num2+1)
    }} ></button>
  </>
);
}
export default App;
